import base64
from PIL import ImageFile

def b64decode_image(s, name):
    """
    解码 Base64 编码的 Data Uri
    """
    p = ImageFile.Parser()
    s = s.split('data:image/png;base64,')[-1]
    p.feed(base64.b64decode(s))
    im = p.close()
    im.save(name)

if __name__ == "__main__":
    images = {
        'image.png':'data:image/png;base64,'
    }
    for name, img in images.items():
        b64decode_image(img ,name)